import React from "react";
import Button from 'react-bootstrap/Button'
import Card from 'react-bootstrap/Card'


function LoginPage() {



    return (
        <div className="" style={{paddingTop: '4rem'}}>
            <div className="container" style={{ maxWidth: '400px' }}>
                <Card style={{ width: '18rem' }}>
                    <Card.Body  className="d-flex flex-column justify-content-center align-items-center">
                        <Card.Title style={{paddingTop: '25px'}}>SLVSH BRACKET</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted" style={{paddingTop: '10px'}}>Welcome</Card.Subtitle>
                        <Button style={{paddingTop: '25px'}} >Login</Button>
                        <div className="" style={{paddingTop: '25px'}}>or</div>
                        <div className="" style={{paddingTop: '25px'}}>Create Account</div>
                    </Card.Body>
                </Card>
            </div>
        </div>
    );
}

export default LoginPage;
